script: |
  super -f text -I q3350.spq | sort > q3350.out

inputs:
  - name: q3350.spq
    data: |
      SELECT DISTINCT + ( - col0 ) * 29 + + + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - + 69 NOT BETWEEN - - CAST ( + col0 AS INTEGER ) AND NULL;
  - name: tab0

outputs:
  - name: q3350.out
    data: |
